INSERT INTO `actividades` VALUES
(1,1,'MINI ATLETISMO','MIXTO','El atletismo es una disciplina deportiva que incluye una variedad de eventos que se dividen en carreras, saltos y lanzamientos. Este deporte se practica tanto en pista como en campo y se caracteriza por la competición en pruebas de velocidad, resistencia,','El atletismo es uno de los deportes más antiguos y completos, que abarca una amplia gama de disciplinas basadas en las capacidades físicas básicas del ser humano: correr, saltar y lanzar. Considerado como el deporte fundamental para el desarrollo físico integral, la diversión y el aprendizaje de habilidades.\r\n\r\nEntre los principales beneficios del atletismo se encuentran el acondicionamiento físico, el fomento del trabajo en equipo, el desarrollo de habilidades motoras, el fortalecimiento de la salud física, la socialización, la promoción de la deportividad, así como el aumento de la confianza y la autoestima. ','deportes\\iconos\\atletismo_icon.png','deportes\\imagenes\\atletismo_mini.jpg'),
(2,1,'MINI SOCCER VARONIL','VARONIL','El fútbol se juega en diversas modalidades (7, 9 y 11 jugadores) con distintas dimensiones de cancha. El objetivo es introducir el balón en la portería rival usando cualquier parte del cuerpo excepto las manos. ','Es un deporte muy popular en todo el mundo, lo practican hombres y mujeres, se juega con dos equipos rivales, un árbitro y un balón, se juega con los pies, cabeza, muslo y pecho, no están permitidas las manos, solo el portero es el único que puede utilizar todas las partes del cuerpo.\r\n\r\nEste deporte no solo requiere habilidades físicas, sino también tácticas, promoviendo el trabajo en equipo, la disciplina mental, la socialización, la deportividad y la autoconfianza.','deportes\\iconos\\futbol_icon.png','deportes\\imagenes\\futbol_mini.jpg'),
(3,1,'MINI SOCCER FEMENIL','FEMENIL','El fútbol se juega en diversas modalidades (7, 9 y 11 jugadores) con distintas dimensiones de cancha. El objetivo es introducir el balón en la portería rival usando cualquier parte del cuerpo excepto las manos. ','Es un deporte muy popular en todo el mundo, lo practican hombres y mujeres, se juega con dos equipos rivales, un árbitro y un balón, se juega con los pies, cabeza, muslo y pecho, no están permitidas las manos, solo el portero es el único que puede utilizar todas las partes del cuerpo.\r\n\r\nEste deporte no solo requiere habilidades físicas, sino también tácticas, promoviendo el trabajo en equipo, la disciplina mental, la socialización, la deportividad y la autoconfianza.','deportes\\iconos\\futbol_femenil_icon.png','deportes\\imagenes\\futbol_mini.jpg'),
(4,1,'MINI BASKET','MIXTO','El básquetbol es un deporte de 5 contra 5, donde el objetivo es anotar más puntos que el rival. Se juega con diferentes defensas (zona, personal o mixta) y es conocido por su dinamismo y velocidad. Michael Jordan es considerado el máximo exponente de este','El basketball es el segundo deporte más practicado en mexico y podemos encontrar casi en cada escuela o colonia una cancha para la actividad. Fisicamente el basketball es una activdad muy completa que favorece la resistenca, la fuerza y la velocidad principalmente.\r\nAl ser un deporte de equipo nos ayuda a el desarroollo de valores en categorias formativas. Suele ser un deporte con muchas emociones.','deportes\\iconos\\basquetbol_icon.png','deportes\\imagenes\\basquet_mini.jpg'),
(5,1,'MINI VOLEIBOL','MIXTO','Juego entre dos equipos de 6 integrantes, separados por una red colocada en alto a la mitad de la cancha, el objetivo es pasar el balón a la cancha contraria impulsado por las manos y/o brazos.','El voleibol es un deporte de alto nivel técnico practicado por Niños y Niñas, donde aprenderán el valor de la cooperación y el trabajo en equipo.\r\nEs un deporte con un alto componente socializador, en el cual también desarrollarán el control mental, el equilibrio y la concentración.','deportes\\iconos\\voleibol_icon.png','deportes\\imagenes\\voleibol_femenil.jpg'),
(6,1,'MINI CHEER DANCE','FEMENIL','Es una combinación entre danza y acrobacia con toques técnicos de danza jazz utilizando como accesorio indispensable pompones que se acompañan de movimientos fuertes y coordinados para la realización de coreografías.','Pompón Dance (también conocido como cheer dance o cheerleading con pompones) es una modalidad dentro del ámbito de la animación, se trata de un estilo de baile enérgico y dinámico caracterizado por el uso obligatorio de pompones durante toda la rutina.','deportes\\iconos\\porristas_icon.png','deportes\\imagenes\\cheer_mini.jpg'),
(7,1,'MINI TOCHO BANDERA','MIXTO','El tochito, variante del fútbol americano, prioriza velocidad y agilidad sobre fuerza. Menos agresivo por la ausencia de contacto, pero igual de exigente, comparte la misma estrategia de juego: lanzar, atrapar, correr y defender, sin el tackleo. Esta diná','Es una variante del fútbol americano, pero sin contacto físico directo. En lugar de detener al portador del balón, los defensores deben quitar una bandera que cuelga de la cintura del oponente que lleva el balón . Es un deporte muy popular en muchos lugares, especialmente entre los jóvenes, ya que implica menor riesgo de lesiones , ademas de que sera deporte Olimpico a partir de los siguientes juegos Olimpicos del 2028.\r\n \r\nEntre los beneficios del tocho se encuentran el acondicionamiento físico, el trabajo en equipo, las habilidades tácticas, la disciplina mental, la socialización, la deportividad y la autoconfianza, aspectos que lo convierten en una opción atractiva tanto para la recreación como para la competencia. ','deportes\\iconos\\icono_bandera.png','deportes\\imagenes\\tocho_mini.jpg'),
(8,1,'MINI PADEL','MIXTO','El pádel, originario de México, es un deporte que se juega con pala y pelota en una pista más pequeña que la de tenis. Combina elementos de este y del squash, siendo divertido y accesible para todas las edades y niveles.','Es un deporte en el que se desarrollan muchas habilidades físicas, especialmente la velocidad, reacción, resistencia y coordinación óculo-mano.Normalmente se juega a ganar 2 set cada uno a seis juegos. Se juega en formato de parejas. Existe un World Tour Pádel por su gran popularidad que ha tenido en el mundo en la que se juega el pádel a su máxima expresión.\r\n','deportes\\iconos\\paddle_icon.png','deportes\\imagenes\\padel.jpg'),
(9,1,'ATLETISMO','MIXTO','El atletismo es una disciplina deportiva que incluye una variedad de eventos que se dividen en carreras, saltos y lanzamientos. Este deporte se practica tanto en pista como en campo y se caracteriza por la competición en pruebas de velocidad, resistencia.','El atletismo es uno de los deportes más antiguos y completos, que abarca una amplia gama de disciplinas basadas en las capacidades físicas básicas del ser humano: correr, saltar y lanzar. Considerado como el deporte fundamental para el desarrollo físico integral, la diversión y el aprendizaje de habilidades.\r\n\r\nEntre los principales beneficios del atletismo se encuentran el acondicionamiento físico, el fomento del trabajo en equipo, el desarrollo de habilidades motoras, el fortalecimiento de la salud física, la socialización, la promoción de la deportividad, así como el aumento de la confianza y la autoestima. ','deportes\\iconos\\atletismo_icon.png','deportes\\imagenes\\Atletismo.jpeg'),
