(20,1,'PADEL','MIXTO','El pádel, originario de México, es un deporte que se juega con pala y pelota en una pista más pequeña que la de tenis. Combina elementos de este y del squash, siendo divertido y accesible para todas las edades y niveles.\r\n','Es un deporte en el que se desarrollan muchas habilidades físicas, especialmente la velocidad, reacción, resistencia y coordinación óculo-mano.Normalmente se juega a ganar 2 set cada uno a seis juegos. Se juega en formato de parejas. Existe un World Tour Pádel por su gran popularidad que ha tenido en el mundo en la que se juega el pádel a su máxima expresión.\n','deportes\\iconos\\paddle_icon.png','deportes\\imagenes\\Padel.jpeg'),
(21,2,'BUILDING CONNECTIONS','MIXTO','A partir del año 2023 inicia este proyecto llamado Building Connections con el fin de apoyar a los niños a seguir desarrollando algunas áreas como la cognitivas donde estimulan su lenguaje, habilidades matemáticas, lectoescritura, etc.','En este taller los alumnos podrán desarrollar habilidades para hacer amigos, compartir su espacio personal, desarrollar relaciones interpersonales sólidas y una comunicación efectiva. Al mismo tiempo, obtendrán diversión por medio de la participación en diversas actividades que le apoyaran en su desarrollo escolar.','extended_learning\\iconos\\EL_Connections.png','extended_learning\\imagenes\\BUILDING_CONNECTIONS.jpg'),
(22,2,'ECOCLUB','MIXTO',' Algunas de estas actividades son:  Educación ambiental, Gestión de residuos, Consumo de agua y energía y Actividades ambientales comunitarias.','Estamos certificados como Escuela Sustentable aquí en Querétaro desde 2011 y nos desempeñamos como Presidentes del Comité de Escuelas Sustentables de Querétaro durante varios años. Trabajamos con el colegio, incluyendo las áreas de administración y mantenimiento, en actividades relacionadas con la sustentabilidad.','extended_learning\\iconos\\EL_EcoClub.png','extended_learning\\imagenes\\ECOCLUB.jpg'),
(23,2,'ARTE','MIXTO','Además de fomentar la apreciación artística, cuenta con un enfoque en el desarrollo de la imaginación y creatividad de los niños, así como en la mejora de su motricidad fina.','Es una oportunidad para descubrir y desarrollar habilidades en diferentes formas artísticas y aprender a apreciar las obras de arte. Este curso tiene como objetivo ayudar a los estudiantes a desarrollar su creatividad y su capacidad para comunicarse con otras personas a través de imágenes visuales, así como mejorar su autoestima, salud, motivación y calificaciones.','extended_learning\\iconos\\EL_120px-10.png','extended_learning\\imagenes\\ARTE.jpg'),
(24,2,'BAILE','MIXTO','A través del baile, los niños no solo mejoran su coordinación y habilidades motoras, sino que también desarrollan su creatividad y expresión emocional.','Con el baile se apoya el desarrollo psicomotriz, mayor movilidad, fuerza, elasticidad, coordinación, memoria corporal y sobre todo, entusiasmo para lograr cosas nuevas corporalmente y ponerlas en práctica.','extended_learning\\iconos\\EL_120px-05.png','extended_learning\\imagenes\\BAILE.jpg'),
(25,2,'YOGA','MIXTO','El programa de Yoga para niños está diseñado para transmitir las enseñanzas milenarias del yoga y sus múltiples beneficios de una manera accesible, divertida y práctica.','Une el cuerpo y la mente. Se basa en tres elementos principales: ejercicio, respiración y meditación. El Yoga ayuda a mejorar la fuerza muscular y postural, mejora la concentración, nos ayuda a ser más resilientes y a controlar el estrés, la conciencia corporal, el equilibrio y la flexibilidad.','extended_learning\\iconos\\EL_120px-07.png','extended_learning\\imagenes\\YOGAKINDER4.jpg'),
(26,2,'PRE-BALLET I','MIXTO','Iniciación a la técnica del Ballet por medio de actividades lúdicas para descubrir el cuerpo, el movimiento y el ritmo, así como desarrollar fuerza, flexibilidad, coordinación y creatividad.','El Ballet desarrolla valores como disciplina, esfuerzo y trabajo en equipo además de apoyar en el desarrollo de la psicomotricidad, agilidad y coordinación de los movimientos, estimula la circulación sanguínea y el sistema respiratorio.','extended_learning\\iconos\\EL_120px-06.png','extended_learning\\imagenes\\preballet.jpg'),
(27,2,'PRE-BALLET II','MIXTO','Iniciación a la técnica del Ballet por medio de actividades lúdicas para descubrir el cuerpo, el movimiento y el ritmo, así como desarrollar fuerza, flexibilidad, coordinación y creatividad.','El Ballet desarrolla valores como disciplina, esfuerzo y trabajo en equipo además de apoyar en el desarrollo de la psicomotricidad, agilidad y coordinación de los movimientos, estimula la circulación sanguínea y el sistema respiratorio.','extended_learning\\iconos\\EL_120px-06.png','extended_learning\\imagenes\\preballet.jpg'),
(28,2,'TAEKWONDO','MIXTO','El Taekwondo es un arte marcial de origen coreano, muy conocido y popular por la espectacularidad de sus técnicas aéreas, significa literalmente, el “camino del pie y el puño”, no es un deporte de contacto agresivo, sino una filosofía.','El Taekwondo como arte marcial y deporte reúne las condiciones físicas y mentales necesarias para canalizar adecuadamente las energías del niño, desarrollando de manera lúdica y divertida las nociones de:  carácter disciplina, respeto personalidad, confianza, prudencia, saber ganar o perder con humildad.','extended_learning\\iconos\\EL_120px-12.png','extended_learning\\imagenes\\TAEKWONDO_ES.jpg'),
(29,2,'ROBOTICA','MIXTO','La robótica es sumamente beneficiosa para los niños de preescolar, proporcionando una plataforma divertida y educativa que apoya múltiples áreas de su desarrollo.','El propósito de este taller es brindar a nuestros estudiantes clases divertidas y actividades prácticas para desarrollar el deseo de explorar, investigar y aprender a través de la robótica. Ayuda a desarrollar el pensamiento crítico, genera confianza y promueve el trabajo en equipo entre nuestros estudiantes.','extended_learning\\iconos\\EL_120px-15.png','extended_learning\\imagenes\\ROBOTICA-ES.jpg'),
(30,2,'BALLET','MIXTO','Iniciación a la técnica del Ballet por medio de actividades lúdicas para descubrir el cuerpo, el movimiento y el ritmo, así como desarrollar fuerza, flexibilidad, coordinación y creatividad.','El Ballet desarrolla valores como disciplina, esfuerzo y trabajo en equipo además de apoyar en el desarrollo de la psicomotricidad, agilidad y coordinación de los movimientos, estimula la circulación sanguínea y el sistema respiratorio.','extended_learning\\iconos\\EL_120px-06.png','extended_learning\\imagenes\\ballet.png'),
(31,2,'KRAV MAGA','MIXTO','','','extended_learning\\iconos\\EL_120px-08.png','extended_learning\\imagenes\\krav_maga.png'),
(32,2,'JAZZ FUNK','MIXTO','Combinación de técnicas de jazz, lírico, ballet y hip hop. A través de un proceso de preparación técnica y corporal, los estudiantes aprenden un estilo de baile que culmina en una puesta coreográfica.','Las clases de jazz funk son oportunidades de aprendizaje donde los estudiantes pueden explorar y dominar este emocionante género musical y estilo de baile. En las clases de Jazz funk aprenderán técnica de baile, movimientos y pasos característicos del jazz funk, que incluyen giros, saltos, deslizamientos y movimientos rítmicos. Se presta atención a la coordinación, el equilibrio y la fluidez, así como ritmo y musicalidad, improvisación, coreografías, expresión personal y acondicionamiento físico.','extended_learning\\iconos\\jazz_funk_icon.png','extended_learning\\imagenes\\JAZZ.jpg'),
(33,2,'PARKOUR','MIXTO','En nuestras clases, los estudiantes aprenden movimientos como saltos, equilibrio en barras, y técnicas para subir y bajar obstáculos; los más avanzados también adquieren habilidades en acrobacias básicas.','El parkour es el arte del movimiento, enfocado en la creatividad y el autoconocimiento, donde los chicos aprenderán a desplazarse en su entorno, usando los obstáculos que los rodean como herramientas de movimiento.  Trabajarán disciplina, humildad, autoconocimiento, seguridad, psicomotricidad y autoestima al ver los avances en sus logros.','extended_learning\\iconos\\EL_120px-19.png','extended_learning\\imagenes\\PARKOUR.JPG'),
(34,2,'PINCELADAS Y MAS','MIXTO','','','extended_learning\\iconos\\Pinceladas_icono.png','extended_learning\\imagenes\\pinceladas.jpg'),
(35,2,'CLUB DE TEATRO JJ','MIXTO','Además de divertirnos y pasar momentos agradables y enriquecedores, buscamos que los alumnos superen el miedo a presentarse frente a otros, aprendan las bases del teatro y desarrollen sus habilidades escénicas',' A través de diversas dinámicas tanto individuales como grupales, nuestro objetivo es sacar a los participantes de su zona de confort para que descubran su gran potencial y puedan presentarse ante otros con trabajos de alto valor y calidad. El objetivo del taller es que los alumnos de PF a 3er grado de primaria se desenvuelvan en un entorno amigable, seguro y lleno de posibilidades, desarrollando así el gusto por el teatro y la capacidad de presentarse en público. Esto los prepara mejor para las audiciones de cuarto grado para la obra de Elementary School. El taller brinda las bases y herramientas necesarias para que los alumnos adquieran experiencia que les será útil en su futuro y vida cotidiana.','extended_learning\\iconos\\EL_Drama.png','extended_learning\\imagenes\\jj_teatro.jpg'),
(36,2,'ELITE JFK','MIXTO','Si estás interesado en unirte al grupo de Elite, por favor contactar a Fe del Carmen García a través de su correo electrónico: fgarcia@jfk.edu.mx','ELITE es una clase especializada para bailarines con conocimientos de Jazz funcional que ofrece una experiencia enriquecedora y desafiante. Con su enfoque único en la fusión de técnicas de jazz y hip hop, esta clase lleva a los bailarines a nuevos niveles de habilidad, expresión y confianza en sí mismos. Si estás buscando expandir tu repertorio de movimientos, mejorar tu técnica y destacar en el escenario, ELITE es la opción ideal para ti.','extended_learning\\iconos\\EL_Elite.png','extended_learning\\imagenes\\ELITE_JFK.jpg'),
(37,2,'AJEDREZ','MIXTO','El ajedrez escolar ha crecido de manera constante durante la última década, varios estudios han comprobado que es buen para el cerebro de los niños, se considera un deporte en su versión de competencia.','Desarrolla la capacidad de resolver problemas, con razonamiento lógico y pensamiento lateral.  Es una herramienta educativa para enseñar y practicar matemáticas. Ejercita la concentración, memoria visual y dinámica. Desarrolla la creatividad. Aumenta la autoestima y seguridad. Desarrollo de estrategias mnemotécnicas. Trabajo en equipo de acuerdo la implementación de dinámicas. Tolerancia y madurez para ganar o perder.  ','extended_learning\\iconos\\EL_120px-22.png','extended_learning\\imagenes\\AJEDREZ.jpg'),
(38,2,'VIDEOJUEGOS COMPETITIVOS Y JUEGOS DE CAMPAMENTO','MIXTO','Es un taller enfocado a fortalecer aspectos como liderazgo, toma de decisiones, pensamiento crítico, resolución de problemas, motricidad gruesa, motricidad fina, coordinación Ojo-Mano y muchos más a través de actividades de interés para las nuevas generac','Mediante el taller de “Sports & Camp Games”, se realizará una combinación entre, prácticas de juegos de campamento al aire libre y videojuegos. Por medio de los juegos de campamento, los participantes tendrán la oportunidad de conectarse con la naturaleza, fortalecer lazos con sus compañeros y desarrollar habilidades sociales y emocionales, mientras se divierten y disfrutan del entorno, por otro lado, aprenderán mediante los videojuegos competitivos, a desarrollar mejores estrategias, fortalecer el trabajo en equipo, ejercer un liderazgo positivo y desarrollar la toma de decisiones y creación de planes diversos para alcanzar un objetivo.','extended_learning\\iconos\\sport_camp.png','extended_learning\\imagenes\\sport_camp.png'),
(39,2,'SMART MONEY','MIXTO','','','extended_learning\\iconos\\EL_Money.png','extended_learning\\imagenes\\smart_money.jpg'),
(40,2,'ROBOMAKER','MIXTO','En cada clase, los estudiantes aprenden sobre máquinas con diferentes mecanismos para ofrecer soluciones creativas e innovadoras a problemas de la vida cotidiana.',' En robótica, se enseña a diseñar y construir desde máquinas simples hasta robots más complejos, los cuales son programados con software certificado por LEGO Education. Este enfoque facilita el desarrollo del pensamiento lógico-matemático, así como el pensamiento creativo e imaginativo. Los alumnos aprenden explorando, creando y compartiendo.\r\nPara elaborar un proyecto, cada alumno asume un rol con diferentes tareas a realizar, fomentando así la disciplina, el compromiso y la comunicación en el equipo. Las habilidades que se desarrollan en este curso incluyen creatividad, razonamiento lógico-matemático, resolución de problemas, comunicación y trabajo en equipo.','extended_learning\\iconos\\EL_120px-15.png','extended_learning\\imagenes\\ROBOTICA-PS.jpg'),
(41,2,'INGLES','MIXTO','','','extended_learning\\iconos\\EL_ingles.png','extended_learning\\imagenes\\atletismo.png'),
(42,2,'PARKOUR AVANZADO','MIXTO','En nuestras clases, los estudiantes aprenden movimientos como saltos, equilibrio en barras, y técnicas para subir y bajar obstáculos; los más avanzados también adquieren habilidades en acrobacias básicas.','El parkour es el arte del movimiento, enfocado en la creatividad y el autoconocimiento, donde los chicos aprenderán a desplazarse en su entorno, usando los obstáculos que los rodean como herramientas de movimiento.  Trabajarán disciplina, humildad, autoconocimiento, seguridad, psicomotricidad y autoestima al ver los avances en sus logros.','extended_learning\\iconos\\EL_120px-19.png','extended_learning\\imagenes\\PARKOUR.jpg'),
(43,2,'INICIACIÓN MÚSICAL','MIXTO','','Durante el curso, los niños comenzarán a expresar su musicalidad a través de lecciones adaptadas a su edad y experiencia musical previa. De manera integral, los alumnos cantarán y tocarán sobre colores, números, letras y solfeo. Para ayudar a que las notas sean más memorables y fomentar la participación de los cantantes más tímidos, utilizamos señas bilaterales con las manos mientras interpretamos melodías.','extended_learning\\iconos\\iniciacion_icon.png','extended_learning\\imagenes\\musica_ps.png'),
(44,2,'TRICKING (ACROBACIA)','MIXTO',NULL,NULL,'extended_learning\\iconos\\acrobacia_icon.png','extended_learning\\imagenes\\acrobacia.jpg'),
(45,2,'DOBLAJE','MIXTO',NULL,NULL,'icon.png',''),
(46,2,'BAILES REGIONALES','MIXTO','',NULL,'extended_learning\\iconos\\bailes_regionales_icon.png',''),
(47,2,'ORQUESTA JFK (s/instrumento)','MIXTO','Si estás interesado en unirte a la orquesta, por favor contacta al profesor Mauricio Soto a través de su correo electrónico: mjsoto@jfk.edu.mx','La participación en una orquesta ofrece innumerables beneficios para los niños, tanto en su desarrollo personal como académico. Al formar parte de una orquesta, los niños aprenden a trabajar en equipo, desarrollan habilidades de comunicación y mejoran su capacidad de concentración y disciplina. Además, la práctica regular de un instrumento musical fomenta la paciencia y la perseverancia.\r\nLa orquesta también proporciona un entorno creativo donde los niños pueden expresarse artísticamente, lo que contribuye a aumentar su autoestima y confianza en sí mismos. \r\nA través de la música, los estudiantes desarrollan habilidades cognitivas y motoras finas, así como una apreciación por la cultura y el arte. Asimismo, tocar en una orquesta ayuda a los niños a comprender la importancia de la colaboración y el compromiso, valores esenciales tanto en la música como en la vida cotidiana.\r\n','extended_learning\\iconos\\EL_120px-14.png','extended_learning\\imagenes\\orquesta_1.png'),
(48,2,'ORQUESTA JFK (c/instrumento)','MIXTO','Si estás interesado en unirte a la orquesta, por favor contacta al profesor Mauricio Soto a través de su correo electrónico: mjsoto@jfk.edu.mx','La participación en una orquesta ofrece innumerables beneficios para los niños, tanto en su desarrollo personal como académico. Al formar parte de una orquesta, los niños aprenden a trabajar en equipo, desarrollan habilidades de comunicación y mejoran su capacidad de concentración y disciplina. Además, la práctica regular de un instrumento musical fomenta la paciencia y la perseverancia.\r\nLa orquesta también proporciona un entorno creativo donde los niños pueden expresarse artísticamente, lo que contribuye a aumentar su autoestima y confianza en sí mismos. \r\nA través de la música, los estudiantes desarrollan habilidades cognitivas y motoras finas, así como una apreciación por la cultura y el arte. Asimismo, tocar en una orquesta ayuda a los niños a comprender la importancia de la colaboración y el compromiso, valores esenciales tanto en la música como en la vida cotidiana.\r\n','extended_learning\\iconos\\EL_120px-14.png','extended_learning\\imagenes\\orquesta_1.png'),
