(64,1,'TRYOUT FUTBOL SOCCER ','FEMENIL','Este grupo está destinado a la selección de Futbol Soccer. Si deseas formar parte del equipo, es necesario que participes en las pruebas de selección que se realizarán próximamente. ','Es un deporte muy popular en todo el mundo, lo practican hombres y mujeres, se juega con dos equipos rivales, un árbitro y un balón, se juega con los pies, cabeza, muslo y pecho, no están permitidas las manos, solo el portero es el único que puede utilizar todas las partes del cuerpo.\r\n','deportes\\iconos\\futbol_femenil_icon.png','deportes\\imagenes\\futbolfemenil.jpg'),
(65,1,'TRYOUT FUTBOL SOCCER ','VARONIL','Este grupo está destinado a la selección de Futbol Soccer. Si deseas formar parte del equipo, es necesario que participes en las pruebas de selección que se realizarán próximamente. ','Es un deporte muy popular en todo el mundo, lo practican hombres y mujeres, se juega con dos equipos rivales, un árbitro y un balón, se juega con los pies, cabeza, muslo y pecho, no están permitidas las manos, solo el portero es el único que puede utilizar todas las partes del cuerpo.\r\n','deportes\\iconos\\futbol_icon.png','deportes\\imagenes\\Futbol.jpg'),
(66,1,'TRYOUT FLAG FOOTBALL','MIXTO','Este grupo está destinado a la selección de Flag Futbol. Si deseas formar parte del equipo, es necesario que participes en las pruebas de selección que se realizarán próximamente. ','Es una variante del fútbol americano, pero sin contacto físico directo. En lugar de detener al portador del balón, los defensores deben quitar una bandera que cuelga de la cintura del oponente que lleva el balón . Es un deporte muy popular en muchos lugares, especialmente entre los jóvenes, ya que implica menor riesgo de lesiones , ademas de que sera deporte Olimpico a partir de los siguientes juegos Olimpicos del 2028.\r\n','deportes\\iconos\\flag_icon.png','deportes\\imagenes\\Tocho.jpeg'),
(67,1,'TRYOUT BASQUETBAL','FEMENIL','Este grupo está destinado a la selección de Basquetbal. Si deseas formar parte del equipo, es necesario que participes en las pruebas de selección que se realizarán próximamente. ','El basketball es el segundo deporte más practicado en mexico y podemos encontrar casi en cada escuela o colonia una cancha para la actividad. Fisicamente el basketball es una activdad muy completa que favorece la resistenca, la fuerza y la velocidad principalmente.\r\n','deportes\\iconos\\basquetbol_femenil_icon.png','deportes\\imagenes\\Basket.jpg'),
(68,1,'TRYOUT BASQUETBAL','VARONIL','Este grupo está destinado a la selección de Basquetbal. Si deseas formar parte del equipo, es necesario que participes en las pruebas de selección que se realizarán próximamente.','El basketball es el segundo deporte más practicado en mexico y podemos encontrar casi en cada escuela o colonia una cancha para la actividad. Fisicamente el basketball es una activdad muy completa que favorece la resistenca, la fuerza y la velocidad principalmente.','deportes\\iconos\\basquetbol_icon.png','deportes\\imagenes\\Basket.jpg'),
(69,1,'TRYOUT VOLEIBOL MIXTO','MIXTO','Este grupo está destinado a la selección de Volleyball. Si deseas formar parte del equipo, es necesario que participes en las pruebas de selección que se realizarán próximamente.','El voleibol es un deporte de alto nivel técnico practicado por Niños y Niñas, donde aprenderán el valor de la cooperación y el trabajo en equipo.\r\nEs un deporte con un alto componente socializador, en el cual también desarrollarán el control mental, el equilibrio y la concentración.','deportes\\iconos\\voleibol_icon.png','deportes\\imagenes\\voleibol_mixto.jpg'),
(70,1,'TRYOUT VOLLEYBALL','FEMENIL','Este grupo está destinado a la selección de Volleyball. Si deseas formar parte del equipo, es necesario que participes en las pruebas de selección que se realizarán próximamente.','El voleibol es un deporte de alto nivel técnico practicado por Niños y Niñas, donde aprenderán el valor de la cooperación y el trabajo en equipo.\r\nEs un deporte con un alto componente socializador, en el cual también desarrollarán el control mental, el equilibrio y la concentración.','deportes\\iconos\\voleibol_femenil_icon.png','deportes\\imagenes\\voley_femenil.jpg'),
(71,1,'TRYOUT VOLLEYBALL','VARONIL','Este grupo está destinado a la selección de Volleyball. Si deseas formar parte del equipo, es necesario que participes en las pruebas de selección que se realizarán próximamente.','El voleibol es un deporte de alto nivel técnico practicado por Niños y Niñas, donde aprenderán el valor de la cooperación y el trabajo en equipo.\r\nEs un deporte con un alto componente socializador, en el cual también desarrollarán el control mental, el equilibrio y la concentración.','deportes\\iconos\\voleibol_icon.png','deportes\\imagenes\\voleibol_varonil.jpg'),
(73,1,'TRYOUT PADEL','MIXTO','Este grupo está destinado a la selección de Padel. Si deseas formar parte del equipo, es necesario que participes en las pruebas de selección que se realizarán próximamente.','Es un deporte en el que se desarrollan muchas habilidades físicas, especialmente la velocidad, reacción, resistencia y coordinación óculo-mano.Normalmente se juega a ganar 2 set cada uno a seis juegos. Se juega en formato de parejas. Existe un World Tour Pádel por su gran popularidad que ha tenido en el mundo en la que se juega el pádel a su máxima expresión.','deportes\\iconos\\paddle_icon.png','deportes\\imagenes\\Padel.jpeg');
