INSERT INTO `password_resets` VALUES
(3,'kcyrus@jfk.edu.mx','63eb16774e122b479666c9142f5edc942d3e76eddb2b514826c15dc84d80c91a9f51e846f9b030cb58b944f72b2a22741fae','2024-06-22 22:02:00');
INSERT INTO `profesores` VALUES
('0',1,'Sin información','','No hay profesor asignado',''),
('001',2,'Rubén Darío Téllez Sánchez ','001@ejemplo.mx','Egresado de la Facultad de Bellas Artes con especialización en danza contemporánea, cuenta con una trayectoria de más de 20 años en escenarios y proyectos a nivel nacional e internacional. Posee un amplio conocimiento de diversas técnicas de movimiento, desde las formativas hasta los estilos urbanos.\r\nCon una experiencia de más de 20 años en el ámbito educativo, colaborando con diversas instituciones gubernamentales y siendo creador de grupos dancísticos. Impulsor de varios jóvenes en su carrera dancística, facilitando que muchos obtengan títulos en danza.\r\n','extended_learning/profesores/profesor_011.jpg'),
('002',2,'Itzel Xiadani Ibarra Martínez','002@ejemplo.mx','Egresada de la Escuela Nacional de Danza Clásica y Contemporánea (INBAL) como Licenciada en Danza Clásica con línea de trabajo en Docencia. Cuenta con 12 años de experiencia docente, y 25 años de vida dedicados al Ballet y la danza académica. Su formación profesional se complementa con clases de educación creativa y respetuosa, creación coreográfica, iluminación escénica, teatro, análisis del movimiento, kinesiología, y otros estilos de danza. \r\nHa asistido a cursos en la Escuela Nacional de Ballet de Cuba, y en Alemania. Se ha desarrollado como docente en distintas academias particulares y actualmente tiene su\r\npropia academia de Ballet.','extended_learning/profesores/profesor_009.jpg'),
('003',2,'Félix Adriano Ghiringhelli','003@ejemplo.mx','Atleta de Parkour desde 2012, Co-Fundador de SPOT Parkour Academy (2021), academia líder en Latinoamérica con +350 atletas formados en 3 años. Coach Certificado por la WFPF. Enseña Parkour en el JFK desde 2021, creando un espacio seguro y divertido para aprender saltos, equilibrio, superar obstáculos y acrobacias. Este entrenamiento fortalece fuerza, coordinación y agilidad, basado en la filosofía de ser útil, duradero, seguro, con autoconocimiento y humildad.\r\n','extended_learning/profesores/profesor_008.jpg'),
('004',2,'Ana Belen de Jesús González','004@ejemplo.mx','Ingeniera en Mecatrónica egresada de la Universidad Politécnica de Querétaro, con experiencia docente desde 2018. Ha impartido clases de robótica en RobotCenter durante dos años, demostrando pasión por la enseñanza y un enfoque pedagógico basado en la paciencia, el amor y la disciplina. A través de la enseñanza práctica, busca fomentar la comprensión del funcionamiento de las cosas en la vida cotidiana, desarrollando habilidades como motricidad, paciencia, destreza y creatividad en sus alumnos.','extended_learning/profesores/profesor_003.jpg'),
('005',2,'Carlos Resendiz Yañez','005@ejemplo.mx','Profesional en Psicología Educativa con amplia experiencia en enseñanza de Robótica desde 2018. Ha liderado exitosamente equipos estudiantiles en competencias estatales de robótica, obteniendo primeros y segundos lugares en categorías como \"Wedo 1.0 - Robótica en adultos mayores\" y \"Wedo 2.0 - Soluciones de clasificación\", demostrando su capacidad para inspirar y guiar a jóvenes talentos. Especializado en impartir clases de robótica utilizando herramientas como LEGO Education y Arduino Uno, aplica la metodología STEM para fomentar un aprendizaje lúdico y práctico, promoviendo el trabajo en equipo, la resolución creativa de problemas y el desarrollo de habilidades esenciales para el siglo XXI. Su enfoque pedagógico se centra en el diseño, construcción y programación de máquinas y robots, estimulando el pensamiento lógico-matemático, la creatividad, la comunicación efectiva y el interés por la ciencia y la tecnología en sus estudiantes.','extended_learning/profesores/profesor_005.jpg'),
('006',2,'Rodrigo Pedroza Venegas','006@ejemplo.mx','Streamer de videojuegos para Facebook Gaming con 80mil seguidores, enfocado en juegos competitivos como Gears Of War, Overwatch y Age Of Empires. Único \"Gears Honor\" latinoamericano y 1 de los únicos 10 en el mundo. Amplio conocimiento técnico en hardware y software enfocado al streaming de videojuegos profesional. \r\n','extended_learning/profesores/profesor_010.jpg'),
('007',2,'Edén Ayri Miramontes Hernández','007@ejemplo.mx','Apasionado ajedrecista desde su infancia, este entrenador certificado ha convertido su amor por el juego en una vocación. Su trayectoria incluye años de experiencia impartiendo clases a niños y adultos mayores, despertando en ellos la misma fascinación que él sintió al descubrir el ajedrez. Ha colaborado con instituciones educativas y programas gubernamentales como el ISSSTE, llevando los beneficios del ajedrez a diversos sectores de la sociedad. \r\n\r\nSu compromiso con la enseñanza va más allá de la práctica del juego. Su formación académica incluye una maestría en didáctica de las matemáticas, donde investigó el impacto positivo del ajedrez en el aprendizaje, publicando sus hallazgos en revistas especializadas. Esta experiencia le ha permitido desarrollar un enfoque pedagógico único, que combina la diversión del juego con el desarrollo de habilidades cognitivas esenciales.','extended_learning/profesores/profesor_007.jpg'),
('008',2,'Blanca Alicia Alvarado Pérez','008@ejemplo.mx','Licenciada en Educación Musical por la UAQ, Maestra en Educación por la Escuela Marista y dos certificaciones en Disciplina Positiva para Maestros de la Primera Infancia y Padres de Familia.\r\nProfesora y directora en escuelas públicas y profesora de música en preescolar durante 32 años en el JFK.\r\n','extended_learning/profesores/profesor_004.jpg'),
('009',2,'Alvaro Osornio Nuñez','009@ejemplo.mx',NULL,'extended_learning/profesores/profesor_002.jpg'),
('010',2,'Monica Díaz Moctezuma','mmoctezuma@jfk.edu.mx','Licenciada en Ciencias de la Educación, egresada de la Universidad La Salle en 2002. A lo largo de mi trayectoria profesional, ha complementado su formación con diversos cursos de arte, como Arteterapia, Artes Visuales y Journal Art.\r\n','extended_learning/profesores/profesor_006.jpg'),
('011',2,'Edgar Abelleyra','eabelleyra@jfk.edu.mx','Profesional con amplia experiencia en liderazgo, trabajo en equipo y comunicación, apasionado por el teatro desde temprana edad. Ha participado activamente en puestas en escena desde la primaria hasta la universidad, destacando su participación de 3 años en el equipo Representativo de Teatro universitario, donde actuó en obras como \"Argonautika\", \"Noches de Arabia\" y \"El Inspector de Gobierno\".\r\n\r\nComo instructor de teatro, se enfoca en crear un ambiente seguro y divertido donde los niños puedan desarrollar habilidades escénicas, como expresión corporal, vocalización y improvisación. A través de dinámicas lúdicas y ejercicios creativos, busca que los participantes pierdan el miedo a presentarse en público, fortalezcan su autoestima y descubran su potencial expresivo.\r\n\r\nCree firmemente en el poder transformador del teatro, considerándolo un espacio mágico donde los niños pueden explorar su creatividad, superar sus límites y desarrollar habilidades sociales y emocionales fundamentales. Su objetivo como instructor es inspirar a las nuevas generaciones a amar el teatro y descubrir todo lo que este arte puede ofrecerles tanto a nivel personal como profesional.','extended_learning/profesores/profesor_001.jpg'),
('012',2,'Marlene Cruz Lopez','mcruz@jfk.edu.mx',NULL,'extended_learning/profesores/profesor_012.jpg'),
('013',2,'Mercedes Reyes','013@ejemplo.mx','Desde el año 2012, se dedica a impartir clases de yoga para niños en colegios, centros creativos y cursos de verano. Cuenta con diversas certificaciones en yoga infantil: en 2012 obtuvo la certificación por Radiant Child Yoga, en 2016 completó el diplomado por Yoguitos y en 2017 se certifica con Yogi Minds for Kids.','foto_profesor.png'),
('015',2,'Mauricio Soto','015@ejemplo.mx','Se inició en la música a los 7 años, guiado por su padre, Juan Soto. Ha formado parte de orquestas en Uruguay, Argentina y México. Obtuvo la licenciatura en Corno Francés en 1996 en la Universidad del Uruguay y una Maestría en Música en la Universidad de Georgia. Ha impartido cursos en varias instituciones de México y fue profesor en el Hartwick College Summer Music Festival & Institute (1998-2008). Actualmente, es profesor en la Universidad Panamericana, Corno Principal de la Orquesta Filarmónica de Querétaro y Director del Programa de Orquesta Sinfónica de la Escuela John F. Kennedy.','foto_profesor.png'),
('016',2,'Carlos León Salinas','016@ejemplo.mx','Licenciado en Música, egresado de la Facultad de Bellas Artes de la Universidad Autónoma de Querétaro. He trabajado como docente de música en diversos colegios, entre ellos el Fray Luis de León, y actualmente me desempeño como Profesor de Música en el Kinder JFK y en el Programa de Iniciación Musical de Extended Learning. He tenido la oportunidad de tocar en numerosos ensambles y me enorgullece haber participado como becario y profesor en el programa de la Orquesta JFK de Elementary School.','extended_learning/profesores/profesor_016.jpg'),
('017',2,'Julio Osio','017@ejemplo.mx',NULL,'foto_profesor.png'),
('018',2,'Ximena de Léon','018@ejemplo.mx',NULL,'extended_learning/profesores/ximena_de_leon.jpg'),
('019',2,'Andres Ruíz','019@ejemplo.mx',NULL,'foto_profesor.png'),
('020',2,'Antares Hernández','',NULL,'extended_learning/profesores/SIRVENT_ANTARES.jpg'),
('021',2,'Lorena Gastelum','',NULL,'foto_profesor.png'),
('022',2,'Paola Baños','',NULL,'extended_learning/profesores/profesor_paola_baños.jpg'),
('023',2,'Leonel Méndez','',NULL,'extended_learning/profesores/profesor_leonel_mendez.jpg'),
('024',1,'Omar González','',NULL,'foto_profesor.png'),
('2466',1,'Claudia Noelia Ramírez Martínez','cramirez@jfk.edu.mx','Coach de porristas y coreógrafa de baile con una amplia experiencia en varias instituciones, incluyendo la Escuela John F. Kennedy (desde 2021, como Coordinadora), Colegio Helen Keller (desde 2021), Colegio Timber (desde 2023), y Colegio Fontanar (2003-2021). También ha trabajado en Kidú Fontanar (2003-2020), Kidú Álamos (2010-2020), Club Britania (2003-2006), Instituto Queretano (2002-2003), Dance Gym (1997-2007), y Universidad CUMDES (1997-1998).','deportes/profesores/profesor_016.jpg'),
('2484',1,'Jaime Eder Rodriguez Perez','jrodriguez@jfk.edu.mx','Licenciado en Educación Física y Ciencias del Deporte, con certificación por la FMVB y amplia formación mediante cursos nacionales e internacionales. Con 20 años de experiencia como entrenador, incluyendo 7 años en JFK, participando activamente en torneos nacionales como Asomex, Condde, Conadeip y eliminatorias de Olimpiada Nacional. Actualmente, responsable de los equipos de Volei de Infantil, Juvenil B Femenil y Juvenil C varonil en JFK.','deportes/profesores/profesor_020.jpg'),
('2485',1,'Miguel Angel Reyes Rodriguez','mreyes@jfk.edu.mx','Licenciado en Educación Física y Ciencias del Deporte obtenida en la Universidad Autónoma de Querétaro, complementada con una Maestría en Ciencias del Deporte y del Ejercicio en Unipuebla. Posee Licencia Tipo A, B, C y D otorgada por la Federación Mexicana de Fútbol.','deportes/profesores/profesor_017.jpg'),
('2486',1,'Armando Najera Reyes','anajera@jfk.edu.mx','Maestría en Desarrollo de la Motricidad por UNIPUEBLA, Entrenador Físico Deportivo certificado por ITPF, Licenciado en Entrenamiento Deportivo graduado de ENED, y Preparador Físico formado en ENPREFI. Con más de 8 años de experiencia como entrenador en JFK.','deportes/profesores/profesor_014.jpg'),
('2495',1,'David Saul Tellez Avila','dtellez@jfk.edu.mx','Entrenador de flag football con más de una década de experiencia en diversas instituciones y clubes del estado, incluyendo Cimarrones, Colegio Plenus y Universidad de Arcansas. Experiencia con diversas categorías, desde preinfantil hasta nivel universitario, obteniendo campeonatos y participando en eventos nacionales con las categorías U12 y U14. Además de la experiencia en flag football, cuenta con certificaciones como preparador físico y en nutrición. Actualmente, coordinador de Tocho en JFK.','deportes/profesores/profesor_024.jpg'),
('2496',1,'Alejandra Pozas Bautista','apozas@jfk.edu.mx','Licenciada en Entrenamiento Deportivo y Pedagogía, con Diplomado en Psicología Deportiva Infantil. Entrenadora certificada por FMAA y con certificación WADA. Formación complementada con cursos nacionales e internacionales. Encargada de las categorías juveniles en JFK durante 3 años y actualmente Coordinadora de Atletismo en JFK. Especializada en desarrollar programas que promueven el crecimiento y rendimiento óptimo de los atletas juveniles.','deportes/profesores/profesor_015.jpg'),
('2497',1,'Erick Alexis Robles Salgado','erobles@jfk.edu.mx','Licenciado en Entrenamiento Deportivo especializado en Baloncesto (ENED). Maestría en Actividad Física, Entrenamiento y Gestión Deportiva. Diplomados en Entrenamiento Deportivo (TEC. DE MONTERREY), Salud (Universidad Panamericana) y Psicología Deportiva Infantil (ILEP). Con 27 años de experiencia como entrenador en instituciones educativas de nivel primario, secundario, preparatoria y universidad, participando en eventos estudiantiles como CONADEIP, ABE, ASOMEX, y en ligas estudiantiles como ODECOP, PREMIER, ELITE, entre otras. Amplia formación mediante cursos nacionales e internacionales. Entrenador de Selecciones Estatales en Ciudad de México y Querétaro. Actualmente, empleado en el colegio John F. Kennedy desde 2021.','deportes/profesores/profesor_019.jpg'),
('2507',1,'Samantha Alvarado Rios','salvarado@jfk.edu.mx','Licenciada en Educación Física y Ciencias del Deporte, entrenadora certificada por la FMVB, con amplia formación mediante cursos nacionales e internacionales. Con 9 años de experiencia en JFK, participando activamente en torneos nacionales como Asomex, Condde y Conadeip. Actualmente, lidero las actividades en Kinder y los equipos de cachibol mixto y Juvenil A femenil en JFK Volei, enfocada en el desarrollo integral de los deportistas.','deportes/profesores/profesor_001.jpg'),
('2511',1,'Omar González Rodríguez','orodriguez@jfk.edu.mx','Licenciado en Educación Física y Licenciado en Acondicionamiento Físico y Recreación con 20 años de experiencia. Especializado en basketball estudiantil con 11 años de dedicación. Logros destacados incluyen el título de Campeón en Cocaba U16 Femenil en San José, Costa Rica (2016), y en Centrobasket U17 Femenil en Aguada, Puerto Rico (2017). Además, obtuvo el 7° lugar en el Premundial U18 Femenil en la Ciudad de México en 2018. Campeón Nacional Conadeip Juvenil C en 2016. Actualmente, se desempeña como Coordinador de Basketball en JFK desde 2023.','deportes/profesores/profesor_006.jpg'),
('2562',1,'Jose Abel Rivera Suarez','arivera@jfk.edu.mx','Entrenador especializado en porteros con 9 años de experiencia. Ha trabajado con porteros en diversas categorías, tanto femeninas como masculinas, desarrollando tanto aspectos técnicos como tácticos. Además, ha recibido 9 años de capacitación continua a través de la participación en congresos, diplomados, entre otros, proporcionados por la escuela.','deportes/profesores/profesor_018.jpg'),
('2588',1,'Carlos Javier Lopez Mata','clopez@jfk.edu.mx','Entrenador certificado por la FIVB y FMVB, con certificación como árbitro estatal y regional por la AQVB y FMVB. Ha realizado múltiples cursos nacionales e internacionales de capacitación en diversas áreas. Con 35 años de experiencia como entrenador y 27 años en JFK, ha participado en torneos nacionales Asomex, Condde, Conadeip, juegos nacionales de Educación Media Superior y eliminatorias de Olimpiada Nacional. Actualmente, Coordinador de Voleibol y entrenador del equipo Juvenil C Femenil en JFK.','deportes/profesores/profesor_009.jpg'),
('2589',1,'Horacio Morales Gutiérrez','hmorales@jfk.edu.mx','Desarrollador Técnico certificado por la FEMEXFUT, con 30 años de experiencia como entrenador de fútbol. Se ha desempeñado durante 24 años en JFK, cubriendo diversas categorías, desde preescolar varonil hasta primaria y secundaria femenil. Durante los últimos 18 años, ha sido Coordinador del equipo de High School Varonil. Además, ha recibido 24 años de capacitación proporcionada por la escuela, incluyendo congresos, diplomados, entre otros.','deportes/profesores/profesor_013.jpg'),
('2610',1,'Juan de Jesús Casas Rojas','jrojas@jfk.edu.mx','Licenciado en Educación Física y Ciencias del Deporte. Diplomado en Psicología del Deporte Infantil y participante en el Congreso Mundial en Ciencias de Educación Física. Encargado de las categorías infantiles de Atletismo en JFK durante 1 año.','deportes/profesores/profesor_004.jpg'),
('2611',1,'José Rodrigo Marín García','rmarin@jfk.edu.mx','Licenciado en Fisioterapia con certificación como Preparador Físico profesional de fútbol avalado por la Federación Mexicana de Fútbol. Además, posee la acreditación como Director Técnico de fútbol infantil respaldado por la SEP y CONADE. Con una experiencia de 2 años a nivel universitario en la UDLAP y 6 años como entrenador y preparador físico en la Tercera División Profesional (TDP). Sumado a esto, cuenta con 4 años de experiencia como Director Técnico en escuelas y academias de fútbol, así como 1 año en el ámbito del fútbol femenil.','deportes/profesores/profesor_011.jpg'),
('2612',1,'Galilea Becerril Alvarado','gbecrril@jfk.edu.mx','Actualmente, entrenadora en John F. Kennedy en categorías infantiles, participación en festival colegial en Aguascalientes en 2023. Certificación de la WADA para juegos CONADE. Clínica Jr. NBA y \"mini defensa\" con la participación de Nicolás Casalánguida, entrenador argentino en la LNBP.  En 2010-2009, campeón internacional en el \"Torneo Internacional BBP\" en Costa Rica. En 2013-2014, campeón estatal y pase a Nacional en el \"Torneo Elite\" femenil.  Otros logros incluyen el tercer lugar en el Festival Intercolegial en Aguascalientes 2023, y el campeonato en la Liga ODECOP en Querétaro en 2023.','deportes/profesores/profesor_003.jpg'),
('2613',1,'Salvador Mancha Jimenez','smancha@jfk.edu.mx','Licenciado en Educación Física y Ciencias del Deporte por la Universidad Autónoma de Querétaro, con Maestría en Gestión Deportiva por la Universidad de La Salle. Entrenador de pádel, natación y triatlón. Más de 8 años como entrenador de tenis en el Tec de Monterrey Campus Querétaro y 10 años como administrador y metodólogo en el deporte de gobierno. Actualmente, Coordinador de Pádel en JFK.','deportes/profesores/profesor_010.jpg'),
('2614',1,'Freddy Becerra Trinidad','fbecerra@jfk.edu.mx','Licenciado en Educación Física con experiencia como Director Técnico. Con una trayectoria laboral de 20 años en colegios, enfocado en las Fuerzas Básicas y el fútbol profesional, incluyendo participación en selecciones estatales.','deportes/profesores/profesor_002.jpg'),
('2615',1,'Getzemani Garcia Galvan','ggarciag@jfk.edu.mx','Licenciado en Educación Física y Deporte con 15 años de experiencia en varias categorías deportivas. Preparador Físico, Terapeuta Rehabilitador y Kinesiólogo. Especialista en divisiones formativas por la ESCOLA SUPERIOR DE TREINADORES DO FUTEBOL DO BRASIL. Certificado en medición y metodología de preparación física por la FMF y ICAFUT respectivamente.','deportes/profesores/profesor_005.jpg'),
('2617',1,'José Alejandro Martinez Rojas','jmartinez@jfk.edu.mx','Licenciado en Ciencias del Ejercicio (UANL, Mx) y Máster en Preparación Física de Fútbol Profesional (UEMC, Es), con 15 años de experiencia como Entrenador y Preparador Físico en fútbol. Ha colaborado con instituciones universitarias y colegios privados como Tec Campus Mty, UDEM y San Roberto. Además, ha trabajado en el ámbito profesional tanto en México como en el extranjero, incluyendo equipos como Correcaminos en la liga de ascenso, así como Motagua y Real España en Honduras. También cuenta con experiencia en JFK durante un ciclo escolar.','deportes/profesores/profesor_012.jpg'),
('2619',1,'Jorge Lardinois Salazar','jlardinois@jfk.edu.mx','Licenciado en entrenamiento deportivo con especialidad en basquetbol, 27 años como entrenador de basquetbol. Participación en ligas y torneos nacionales estudiantiles. Coordinador de los departamentos de ambiente, deporte y disciplina en el Instituto Don Bosco. Coordinador de actividades acuáticas y terrestres deportivo Salvador Allende cdmx alcaldía Iztapalapa. Actualmente entrenador de basquetbol colegio JFK.','deportes/profesores/profesor_008.jpg'),
('2620',1,'Paola Toyana Rojas','projas@jfk.edu.mx','Licenciada en Danza Contemporánea por el CENADAC. Experiencia como entrenadora en cheer dance, obteniendo campeonatos estatales y participando en competencias regionales y nacionales. En el Colegio Fontanar (2005-2023), entrenadora de jazz y poms, logrando campeonatos nacionales. En Chasse Dance Studio (2007-2022), directora y entrenadora de equipos competitivos en jazz, poms y hip hop.','deportes/profesores/profesor_021.jpg'),
('2646',1,'Jessica Hernandez Aranda','jaranda@jfk.edu.mx ','Licenciada en Ciencias del Deporte con 5 años de experiencia en el Deporte Estudiantil en niveles de Licenciatura y Bachillerato, y 2 años en niveles prescolar y primaria. Además, cuenta con 10 años de experiencia en el deporte de alto rendimiento como deportista, formando parte de la Selección Mexicana de Fútbol y la Selección Universitaria de La Salle.','deportes/profesores/profesor_007.jpg'),
('2655',1,'Santiago Diaz Ezcurra','sdiaz@jfk.edu.mx','Con 20 años de experiencia como jugador de fútbol americano, ha desempeñado el rol de coach de flag durante los últimos 6 años, trabajando con diversas categorías, desde niños de 6 años hasta universitarios. Durante este tiempo, ha obtenido varios campeonatos, incluyendo el título nacional con la categoría U13 en 2016, y representar a México en un encuentro contra la selección de California en el mismo año.','deportes/profesores/profesor_022.jpg'),
('61',1,'Fernando Soria Hernández','fsoria@jfk.edu.mx','Desarrollador Técnico Profesional avalado por la FMF, con experiencia en diversos cursos y diplomados tanto a nivel nacional como internacional. Con una trayectoria laboral de 30 años en la escuela JFK, actualmente involucrado en el equipo de fútbol a nivel preparatoria y desempeñando el rol de Coordinador del área de fútbol Femenil.','deportes/profesores/profesor_023.jpg');
