CREATE PROCEDURE `getCategoriasAlumno`(IN p_matricula_alumno int)
BEGIN
    SELECT
        LEFT(gj.`grupo-jfk`, LENGTH(gj.`grupo-jfk`) - 1) AS grupo,
        DATE_FORMAT(a.fecha_nacimiento, '%Y') AS anio
    FROM alumnos a
    INNER JOIN `ciclos_secciones_grupos_alumnos-jfk` c
        ON a.matricula_alumno = c.matricula_alumno
    INNER JOIN `grupos-jfk` gj
        ON gj.`id_grupo-jfk` = c.`id_grupo-jfk`
    WHERE c.matricula_alumno = p_matricula_alumno;
END ;;
DELIMITER ;
