CREATE PROCEDURE `getFamilies`()
BEGIN
SELECT familias.id_familia, familias.apellido_familia,    REPLACE(familias.nombre_padre, ',', '') as nombre_padre,
					familias.celular_padre,  REPLACE(familias.nombre_madre, ',', '') as nombre_madre,  familias.celular_madre,
					familias.mail_padre, familias.mail_madre,
					GROUP_CONCAT(alumnos.nombre SEPARATOR ', ') AS nombres
					FROM familias
					INNER JOIN alumnos ON alumnos.id_familia = familias.id_familia
					GROUP BY familias.id_familia;
END ;;
