BEGIN
    SELECT secciones.id_seccion, secciones.seccion,
           secciones.logo, secciones.activo
    FROM secciones
    WHERE NOT EXISTS (
        SELECT 1
        FROM administradores_secciones
        WHERE secciones.id_seccion = administradores_secciones.id_seccion
          AND administradores_secciones.id_administrador = p_id_administrador
    );
END ;;
