CREATE PROCEDURE `getStudentByApellido`(IN p_apellido_paterno varchar(32))
BEGIN
SELECT CONCAT(nombre, ' ', apellido_paterno, ' ', apellido_materno)
						AS nombre_completo,
						matricula_alumno,
						nombre,
						apellido_paterno,
						apellido_materno,
						correo_alumno,
						status
					FROM alumnos
					WHERE apellido_paterno LIKE p_apellido_paterno
                    OR nombre LIKE p_apellido_paterno
                    OR apellido_materno LIKE p_apellido_paterno
                    OR alumnos.matricula_alumno LIKE p_apellido_paterno;
END ;;
