CREATE PROCEDURE `getStudentsByGroupGender`(IN p_id_actividad int)
BEGIN
SELECT al.matricula_alumno, CONCAT(al.nombre, ' ', al.apellido_paterno, ' ', al.apellido_materno) as nombre,
        DATE_FORMAT(al.fecha_nacimiento, '%Y') AS anio, LEFT(gj.`grupo-jfk`, LENGTH(gj.`grupo-jfk`) - 1) as grupo, a.id_seccion
					FROM alumnos al
					LEFT JOIN actividades a
						ON a.genero_actividad =
						CASE
							WHEN al.genero_alumno = 'F' THEN 'FEMENIL'
							WHEN al.genero_alumno = 'M' THEN 'VARONIL'
							ELSE ''
						END
						OR a.genero_actividad = 'MIXTO'
					LEFT JOIN `ciclos_secciones_grupos_alumnos-jfk` cs ON cs.matricula_alumno = al.matricula_alumno
					INNER JOIN `grupos-jfk` gj ON gj.`id_grupo-jfk` = cs.`id_grupo-jfk`
					WHERE a.id_actividad = p_id_actividad
					ORDER BY al.apellido_paterno ASC;

END ;;
DELIMITER ;
