CREATE PROCEDURE `get_Secciones_Faltantes_Administrador`(IN id_administrador int)
BEGIN
    SELECT s.id_seccion, s.seccion
    FROM secciones s
    LEFT JOIN administradores_secciones a
        ON s.id_seccion = a.id_seccion
        AND a.id_administrador = id_administrador
    WHERE a.id_seccion IS NULL; -- Solo mostrar las secciones que NO están asociadas
END ;;
